import React from 'react';
import { useSelector } from 'react-redux';
import './App.css';

function App() {
  const {message }= useSelector(state => state.message.messages);
  console.log(message);
  return (
    <div className="App">
      <h1>Random Greeting</h1>
      {message.name}
    </div>
  );
}

export default App;
